import "./App.css";

function App() {
  return <List />;
}

function List() {
  return (
    <section>
      <div className="workingList">
        <h1>Working</h1>
        <Box />
      </div>
      <div className="doneList">
        <h1>Done</h1>
        <Box />
      </div>
    </section>
  );
}

function Box() {
  function boxToDone(ToDone) {
    console.log("콘솔에 찍히나?");
  }

  return (
    <section>
      <div className="boxTitle">
        <h2>리액트 공부하기</h2>
      </div>
      <div className="boxContent">
        <p>리액트 기초를 공부해봅시다</p>
      </div>
      <div className="boxButton">
        <button onClick={boxDelete}>삭제하기</button>
        <button onClick={boxToDone}>완료</button>
      </div>
    </section>
  );
}

export default App;
